import React from "react";
import  Slider from '../'

function Contactus() {
    return (
     <div>

        <Slider/>
        <div className="container">
            <div className="card mt-4">
            <div className="card-body">
                <h2>
                    Contact Page
                </h2>

            </div>

            </div>

        </div>

        </div>
        
    );

}

export default Contactus;
